import React from 'react'

export default function Pagination({rowsPerPage , totalRow}) {
    const pageNumber = [];

    for(let i = 1 ; i <= Math.ceil(totalRow/rowsPerPage) ; i++){
        pageNumber.push(i)
    }
    // console.log("total page is : ",pageNumber);/

    return (
        <div>   
            {
                pageNumber.map(num => (
                    <li key={num}>
                        {num}
                    </li>
                )) 
            }

        </div>
    )
}
